package com.twinflag.touch.model;import org.springframework.data.annotation.CreatedDate;import org.springframework.data.annotation.LastModifiedDate;import javax.persistence.*;import java.util.Date;import java.util.Set;@Entity@Table(name = "t_level_two")public class LevelTwo {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Integer id;    @Column(name = "updatetime")    @LastModifiedDate    private Date updateTime;    @ManyToOne    @JoinColumn(name = "level_one_id")    private LevelOne levelOne;    private String label;    private String title;    private String url;    @Column(name = "ismany")    private boolean isMany;    @Column(name = "createtime")    @CreatedDate    private Date createTime;    @OneToMany(cascade = {CascadeType.ALL}, mappedBy = "levelTwo")    private Set<Content> contents;    public Integer getId() {        return id;    }    public void setId(Integer id) {        this.id = id;    }    public String getLabel() {        return label;    }    public void setLabel(String label) {        this.label = label;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public boolean isMany() {        return isMany;    }    public void setMany(boolean many) {        isMany = many;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public LevelOne getLevelOne() {        return levelOne;    }    public void setLevelOne(LevelOne levelOne) {        this.levelOne = levelOne;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Set<Content> getContents() {        return contents;    }    public void setContents(Set<Content> contents) {        this.contents = contents;    }}